import React from "react";
import style from "UserList.module.css";

function UsersList(props) {
  return (
    <div className="user">
      {props.users &&
        props.users.map((user) => {
          return (
            <p key={user.id}>
              {user.userName} ({user.age} years old)
            </p>
          );
        })}
    </div>
  );
}

export default UsersList;
